import React, {useState} from 'react';
import {loginUrl} from '../../api/Api';
import axios from 'axios';
import {Link, useNavigate} from 'react-router-dom';
import {TextField, Button, Typography,Box} from '@mui/material'

const Login = () => {
  const navigate = useNavigate();
  const initialValue = {
    email: 'inem@gmail.com',
    password: '',
  };

  const [data, setData] = useState (initialValue);

  const handleChange = async e => {
    e.preventDefault ();
    setData (prevState => ({
      ...prevState,
      [e.target.name]: e.target.value,
    }));
  };

  const handleSubmit = async e => {
    e.preventDefault ();
    const userData = {
      email: data.email,
      password: data.password,
    };

    const response = await axios.post(loginUrl, userData);
    console.log ('BC res 1--> ', response);
    if (response.status === 200) {
      console.log ('BC res --> ', response.data);
    }
  };

  const handleNavigate = () => {
    navigate('/forgot-password', {state:{email: data.email}})
  }

  return (
    <Box sx = {{display: 'flex', justifyContent:'center', alignItems:'center',
     width:'100%',height:'inherit'}}>
      <Box component = "form" onSubmit={handleSubmit}>
        <Box>
        <TextField 
        value = {data.email}
        name = "email"
        onChange={handleChange}
        type = "email"
        id="email" 
        label="Email" 
        variant="outlined" />
        
      </Box>
        <Box>
        <TextField
        value = {data.password}
        name = "password"
        onChange={handleChange}
        type = "password" 
        id="password" 
        label="Outlined" 
        variant="outlined" />
          {/* <label htmlFor="">
            password:
            <input
              value={data.password}
              name="password"
              onChange={handleChange}
              type="password"
            />
          </label> */}
       </Box>
        <Box style ={{backgroundColour: 'papayawhip'}}>
          <Button sx = {{fontsize: '20px', fontweight: '700',color:'white',backgroundColor:'red',}} variant = 'contained' type="submit">Submit/</Button>
        </Box>
      </Box>
      <Typography onClick={handleNavigate}>Forgot Password</Typography>
    </Box>
  );
};

export default Login;
